const mapScale = (num, in_min, in_max, out_min, out_max) => {
  return (num - in_min) * (out_max - out_min) / (in_max - in_min) + out_min;
}

let PerspectiveCamera = this.getObjectByName("PerspectiveCamera")
let _3rdPersonCamera = this.getObjectByName("_3rdPersonCamera")
let boatObj = this.getObjectByName("boatObj")
let PointLight = this.getObjectByName("PointLight")
let Sun = this.getObjectByName("Sun")
let HemisphereLight = this.getObjectByName("HemisphereLight")
let PointLightLanturn = this.getObjectByName("PointLightLanturn")
let LanternLightbox = this.getObjectByName("LanternLightbox")
let Water = this.getObjectByName("Water")

window.water = Water

player.setCamera(PerspectiveCamera)
let mainCam = true
let camTime = 0

function update( event ) {
	camTime++;

	let time = event.time * 0.0001

	let time1 = event.time * 0.001
	let time2 = event.time * 0.002

	boatObj.rotation.x = Math.cos(time1) * 0.04
	boatObj.rotation.z = Math.sin(time2) * 0.04

	if(camTime % 1000 == 0)
		mainCam = !mainCam;

	if(mainCam) player.setCamera(PerspectiveCamera)
	else player.setCamera(_3rdPersonCamera)

	// _3rdPersonCamera.position.x = Math.cos(time) * 8
	// _3rdPersonCamera.position.z = Math.sin(time) * 8

	_3rdPersonCamera.lookAt(0, 0, 0)

	PerspectiveCamera.rotation.x = Math.cos(time2) * 0.02

	PointLight.position.z = Math.cos(time) * 35
	PointLight.position.y = Math.sin(time) * 20

	let intensity = mapScale(PointLight.position.y, -5, 15, 0, 0.5)
	//if(intensity < 0) intensity = 0

	HemisphereLight.intensity = intensity;

	Sun.position.z = Math.cos(time) * 35
	Sun.position.y = Math.sin(time) * 20

	let intensity2 = mapScale(PointLight.position.y, -15, -5, 1, 0)
	if(intensity2 < 0) intensity2 = 0

	PointLightLanturn.intensity = intensity2

	//PerspectiveCamera.lookAt(new THREE.Vector3(Sun.position.x, Sun.position.y, Sun.position.z))
}

